import React from 'react'
var loginCSS= require('./login.css')

export default class LoginPage extends React.Component{
    render(){
        return(
           <div className={loginCSS.login}>
               <h2 className={loginCSS.login}>登录界面</h2>
               <div className={loginCSS.login}>
            <input type="text" placeholder="用户名" style="color:white"></input>
            </div>
            <div>
            <input type="text" placeholder="密码" style="color:white"></input>
            </div>
            <br></br>
            <button className={loginCSS.login}>登录</button>
            </div>
        )
    }
}
